renderBg = function renderBg() {
    ctx.fillRect(0, 0, canvas.w, canvas.h);

    // tiles
    let timeOffset = 0

    if ((window.flowrMod.detailedBackgrounds !== true || window.flowrMod.biomeURLs[biomeManager.currentBiome] === undefined) && window.flowrMod.noGrid !== true) {
        timeOffset = (-time / 20) % 50;
    } else {
        timeOffset = (-time / 20) % 450
    }

    ctx.lineWidth = 2;
    ctx.globalAlpha = 1;
    if ((window.flowrMod.detailedBackgrounds !== true || window.flowrMod.biomeURLs[biomeManager.currentBiome] === undefined) && window.flowrMod.noGrid !== true) {
        for (let x = timeOffset - ctx.lineWidth; x <= canvas.w + ctx.lineWidth; x += tileSize) {
            ctx.beginPath();
            ctx.moveTo(x, 0);
            ctx.lineTo(x, canvas.h);
            ctx.stroke();
            ctx.closePath();
        }
    }

    if ((window.flowrMod.detailedBackgrounds !== true || window.flowrMod.biomeURLs[biomeManager.currentBiome] === undefined) && window.flowrMod.noGrid !== true) {
        for (let y = -timeOffset - ctx.lineWidth; y <= canvas.h + ctx.lineWidth; y += tileSize) {
            ctx.beginPath();
            ctx.moveTo(0, y);
            ctx.lineTo(canvas.w, y);
            ctx.stroke();
            ctx.closePath();
        }
    }
    ctx.globalAlpha = 1;

    if (window.flowrMod.detailedBackgrounds === true && window.flowrMod.biomeURLs[biomeManager.currentBiome] !== undefined) {
        let bg = {};
        bg.image = new Image();
        bg.image.src = window.flowrMod.biomeURLs[biomeManager.currentBiome]
        for (let i = 0; i < Math.ceil(canvas.w / 450) + 1; i++) {
            for (let j = 0; j < Math.ceil(canvas.h / 450) + 1; j++) {
                ctx.drawImage(bg.image, (450 * (i)) + timeOffset, (450 * (j - 1)) - timeOffset, 450, 450)
            }
        }
    }
}

