        ctx.save();

        ctx.beginPath()
        ctx.roundRect(0, 0, this.w, this.h, 3);
        ctx.fill();
        ctx.stroke();
        ctx.clip();
        ctx.closePath();

        const petalContainersPerRow = 5;
        const padding = 35;
